import React, { useEffect, useState } from "react";
import {
  FaMoneyBillWave,
  FaChartLine,
  FaCashRegister,
  FaPercentage,
  FaChartPie,
} from "react-icons/fa";
import { getCash } from "../api/CashApi";
import { performAnalysis } from "../analysis/AnalysisGet";

const Cash = () => {
  const [cashData, setCashData] = useState(null);
  const [analysisData, setAnalysisData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        // Fetch cash data
        const cash = await getCash();
        setCashData(cash);

        // Perform analysis to fetch additional metrics
        const analysis = await performAnalysis();
        setAnalysisData(analysis);
      } catch (error) {
        setError("Error fetching data");
        console.error("Error fetching data:", error);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>{error}</p>;

  return (
    <div className="cash-container">
      <div className="cash-card-container">
        {/* Initial Cash Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaCashRegister className="card-icon" />
            <span className="label">Initial Cash:</span>
            <span className="value">
              {cashData?.initial_cash
                ? `$${cashData.initial_cash}`
                : "Fund Account"}
            </span>
          </div>
        </div>

        {/* Available Cash Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaChartPie className="card-icon" />
            <span className="label">Available Cash:</span>
            <span className="value">
              {cashData?.available_cash ? `$${cashData.available_cash}` : "N/A"}
            </span>
          </div>
        </div>

        {/* Net P/L Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaChartLine className="card-icon" />
            <span className="label">Net P/L:</span>
            <span className="value">
              {cashData?.net_pnl ? `$${cashData.net_pnl}` : "N/A"}
            </span>
          </div>
        </div>

        {/* Cash Balance Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaMoneyBillWave className="card-icon" />
            <span className="label">Cash Balance:</span>
            <span className="value">
              {cashData?.cash_balance ? `$${cashData.cash_balance}` : "N/A"}
            </span>
          </div>
        </div>

        {/* RoI Card */}
        <div className="cash-card">
          <div className="card-content">
            <FaPercentage className="card-icon" />
            <span className="label">RoI:</span>
            <span className="value">
              {analysisData?.totalROI !== undefined
                ? `${analysisData.totalROI}%`
                : "N/A"}
            </span>
          </div>
        </div>

        {/* Additional Metrics */}
        {/* You can add more cards here to display other metrics from analysisData if needed */}
      </div>
    </div>
  );
};

export default Cash;

